The results are polygons that share both the borders and the attributes of both input layers.
Output data;
Intersection Polygons

As a result, a column (column name "Sum" with the population of each polygon is added to the attribute table of the intersection polygons.
Output data;
Intersection_population Polygons

The result is an updated population sum column with the now weighted population.
Output data;
Intersection_population_weighted Polygons
